const Careers = () => {
  return (
    <div className="page">
      <div className="container">
        <h1>Careers</h1>
        <div className="page-content">
          <p>This page will list career opportunities at Marvy Agric Solutions.</p>
        </div>
      </div>
    </div>
  );
};

export default Careers;
